  false,\n\t\"url\": null,\n\t\"notes\": \"Single-beam bathymetry data along with
  GPS navigation data was collected as part of the U.S. Geological Survey cruise S-1-96-WO.
  The cruise was conducted in Cascadia, Washington from April 14 to June 6, 1996.
  The chief scientists were Mike Fisher from the USGS Coastal and Marine Geology office
  in Menlo Park, CA and Ernest Flueh from GEOMAR in Germany. The purpose of this cruise
  was for seismic studies of earthquake hazards posed by the subduction zone off Washington
  and Oregon. These data are reformatted from space-delimited ASCII text files located
  in the Coastal and Marine Geology Program (CMGP) InfoBank field activity catalog
  at http://walrus.wr.usgs.gov/infobank/s/s196wo/html/s-1-96-wo.meta.html into MGD77T
  format provided by the NOAA's National Geophysical Data Center(NGDC). The MGD77T
  format includes a header (documentation) file (.h77t) and a data file (.m77t). More
  information regarding this format can be found in the publication listed in the
  Cross_reference section of this metadata file.\",\n\t\"license_title\": null,\n\t\"extras\":
